import { Integration } from 'discord.js';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

ReactDOM.render(
    <>
        <div className="card">
            <div className="cards">
                <img src="https://source.unsplash.com/daily" alt="mypic" className="card_img"/>
                <div className="card__info">
                    <h3 className="card_titel">Enjoy!</h3>
                    <span className="card_txt">Contrary to popular belief, Lorem Ipsum is not sirem Ipsum passage, and </span>
                    <a href="#" target="_blank" className="card_btn"><button className="btn">Read More</button></a>
                </div>
            </div>
        </div>
    </>,
    document.getElementById('root')
);
